●正味量/40g<br>
●種類/水性形接着剤<br>
●成分/ウレタン樹脂35%、水65%<br>
●接着できる素材/綿、レーヨン、ウール、麻、皮革、合成皮革(表革は除く)<br>
<br>
厚地～普通地用で、アイロンで強力に接着できます。<br>
のりしろを折るときに便利な「折り目つけゲージ」付きです。<br>
<br>
細く出してハケで塗るソフトなシリコンヘッド。細口ノズル・ソフトなハケ型ヘッドだから、細く出してそのまますぐ塗れます。<br>
ドット状にもつけられるから、細かい部分にも塗りやすく、ボンドを出しながら自由自在に塗り拡げられます。<br>
<br>
洗濯、ドライクリーニングOKです。<br>
ファスナー付け、ワッペン・お名前付け、デニムのすそあげに。マチの貼り合わせなど立体的な作業も楽々です。<br>
<br>
[使い方]<br>
1.アイロンでのりしろ部分を折り返します。付属の「折り目つけゲージ」を使えば簡単です。<br>
2.貼りつけたい部分の両面に「貼り仕事」を塗布します。<br>
3.家庭用アイロンの中温（140～160℃・ドライ）で押さえて圧着します。（普通地で約10秒、厚地で約15～20秒）<br>
